import React from 'react';

function Table() {
    return (
        <div>
            <table>
                <thead>
                </thead>

                <tbody>
                    <tr>
                        <td>1</td>
                        <td>2</td>
                        <td>3</td>
                        <td>4</td>
                    </tr>
                </tbody>
            </table>
        </div>

    )
}

export default Table;
